introduction/why-hooks.html.body:
Why Qlik Hooks?
React Hooks are functions that let you "hook into" React state from functional components. They provide a method to extract stateful logic from React components so they can be shared and reused in a declarative format, lessening the need for Class-based React components.
Class-Component
export default class Dog extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      name: "Baxter",
    }

    this.handleNameChange = this.handleNameChange.bind(this)
  }

  handleNameChange(e) {
    this.setState({ name: e.target.value })
  }

  render() {
    return (

        Your dog's name is: {this.state.name}


    )
  }
}

Function Component with Hooks
export default function Dog(props) {
  const [name, setName] = useState("Baxter")

  function handleNameChange(e) {
    setName(e.target.value)
  }

  return (

      Your dog's name is: {name}


  )
}

By using Hooks, we can convert our Class component into a functional component, and manage state more easily across components in our application.

basics/making-api-calls.html.body:
Making API Calls
When we have a Qlik Sense Object Handle, we can call any API method from the Class the handle belongs to. When we connect to the engine and receive an object back, it contains a handle of the Global class type. We can then call any Global Class API method with our object.
Remember, whenever we use a Qlik Hook, it must follow the rules of React Hooks. That means Qlik Hooks should be called from within a React function component, or another custom React hook, and should never be called from inside a loop, a condition block, or a nested function.
Using an API Qlik Hook
Say we have connected to Qlik Engine:
const Component = () => {
  const engine = useConnectEngine({
    host: "sense.axisgroup.com",
    isSecure: true,
  })

  return ...component content
}

The engine object we get back contains a handle of the Global class type that can be used in conjunction with any of the Global API methods. Let's see how we can use this to get the version of our Qlik Engine. First, we need to import the EngineVersion API hook method from the qlik-hooks library
import { useEngineVersion } from "qlik-hooks/Global"

Now we can run the useEngineVersion hook in our React component, passing in the Handle object we are running the method against
const Component = () => {
  const engineVersion = useEngineVersion(engine)
  console.log(engineVersion)
}

We can see this object contains 3 properties: the loading state, the response from the Qlik Engine, and a function to actually call the api method. At this point in time, the API call has been set up, but the request has not yet been sent to the engine. We can also see that qResponse is null, again because we have not yet sent the request. Let's introduce a method for an end user to call the api method.
const Component = () => {
  useEffect(() => {
    console.log(engineVersion)
  }, [engineVersion])

  return  engineVersion.call()}>Get Engine Version
}

When we interact with the button, the EngineVersion method is called, and the engineVersion object temporarily goes into a loading state (with loading set to true) until it finally receives and stores the response from Qlik in the qResponse property.
This is a good start, but what if we don't want to require user interaction to call this API method. Instead we want to just call this method once and have its value. This can be done by calling the useConnectEngine hook with a second input, an object containing the params array that gets passed to the engine with the api call.
const Component = () => {
  const engineVersion = useEngineVersion(engine, { params: [] })
  console.log(engineVersion)

  return null
}

Initially, engineVersion is set to the same state we see in the first example without params initialization, but this time the hook has sent the api request to the engine already, and will soon after get the response back. Initializing an API hook with params doesn't necessarily mean the method call has to be one-and-done. We can still use the call function on the engineVersion object to keep calling the api method at any point in the future.
Asynchronous Object Calls
It is important to understand that the API method calls occuring in Qlik Hooks happen asynchronously. When we call a method such as useEngineVersion, a request is sent to the engine asking for the version, but before the version is returned, our code will continue to run. Because of this, we can't do anything with our engineVersion object until its state updates with the qResponse we need.
If inside a React component we were to run this code:
const Component = () => {
  const engineVersion = useEngineVersion(engine, { params: [] })

  return {engineVersion.qResponse.qComponentVersion}
}

we would get an error because the qResponse property on engineVersion initially has a value of null. It's not until a short time later that the engineVersion state gets updated with the response from the engine.
We instead need to implement our code to check for a valid qResponse before trying to use the data within.
const Component = () => {
  const engineVersion = useEngineVersion(engine, { params: [] })

  return engineVersion.qResponse !== null ? (
    {engineVersion.qResponse.qComponentVersion}
  ) : (
    loading...
  )
}

Connecting Handles
The previous section demonstrates an example of calling an Action Qlik Hook, but what if we want to connect to a new Handle object that has its own set of class API methods. This is necessary if we want to open a Qlik Application, or create new objects within an app that calculate data tables (take a look at the QAE Class Hierarchy for a refresher on class layouts).
Connecting to an application would look something like this
import { useConnectEngine } from "qlik-hooks"
import { useOpenDoc } from "qlik-hooks/Global"

const Component = () => {
  const engine = useConnectEngine({
    host: "sense.axisgroup.com",
    isSecure: true,
  })

  const doc = useOpenDoc(engine, { params: ["aae16724-dfd9-478b-b401-0d8038793adf"] })

  return component content
}

Now, we have a doc object that contains a handle of the type Doc, and we can run any Doc API class.

basics/initializing-api-calls.html.body:
Initializing API Calls
You've seen in previous examples how we can call API methods with parameters, but what if we want to initialize an API call definition, but only call it when specific user interaction requires it? Let's walk through an example of when this may be the case.
ListObject
Let's progress the examples we've seen so far to create a GenericObject in a Qlik App that contains a ListObject
import { useConnectEngine } from "qlik-hooks"
import { useOpenDoc } from "qlik-hooks/Global"
import { useCreateSessionObject } from "qlik-hooks/Doc"

const Component = () => {
  const engine = useConnectEngine({
    host: "localhost",
    port: 4848,
    isSecure: false,
  })

  const doc = useOpenDoc(engine, { params: ["Executive Dashboard.qvf"] })

  const listObject = useCreateSessionObject(doc, {
    params: [
      {
        qInfo: { qType: "listbox" },
        qListObjectDef: {
          qDef: { qFieldDefs: ["Region"] },
          qInitialDataFetch: [{ qWidth: 1, qHeight: 100 }],
        },
      },
    ],
  })

  return component content
}

We can fetch data from the ListObject using the GetLayout method, and display it as an unordered list in the jsx we return
//...
import { useState, useEffect } from "react"
import { useGetLayout } from "qlik-hooks/GenericObject"

const Component = () => {
  //...

  const listObjectLayout = useGetLayout(listObject, { params: [] })

  const [list, setList] = useState([])
  useEffect(() => {
    if (listObjectLayout.qResponse !== null) {
      const qMatrix = listObjectLayout.qResponse.qListObject.qDataPages[0].qMatrix

      setList(
        qMatrix.map(row => ({
          label: row[0].qText,
          value: row[0].qElemNumber,
          state: row[0].qState,
        }))
      )
    }
  }, [listObjectLayout])

  return (


        {list.map(listItem => (

            {listItem.label}

        ))}


  )
}

The next logical piece we would want to add to our ListObject is an ability to make selections when a user clicks on a list item. To do that, we need to initialize the useSelectListObjectValues method on our ListObject, but there's one problem, by passing in a params input, we're effectively calling the selection function with an initial state. Instead, we want to initialize the api method, and expose a way for that same method to be called whenever a user interacts with the list.
We can do this by not including a params option to the Qlik Hook, and instead utilizing the call method on the object we create from the hook.
//...
import { useGetLayout, useSelectListObjectValues } from "qlik-hooks/GenericObject"

const Component = () => {
  //...

  const selectListObjectValues = useSelectListObjectValues(listObject)

  const handleListObjectSelection = value => {
    selectListObjectValues.call("/qListObjectDef", [value], true)
  }

  return (


        {list.map(listItem => (
           handleListObjectSelection(listItem.value)}
          >
            {listItem.label}

        ))}


  )
}

By doing this we don't select any values in our ListObject until a user clicks on the list.
This gives us an almost fully working ListObject, but we still aren't getting the selection state of the list items to show. Check out the next section Invalidations to see why.

basics/invalidations.html.body:
Invalidations
There are some API calls we make that return the state of certain objects within a Qlik document. Qlik's associative engine allows us to update the selection state of the document, and when this happens, we want to receive an updated version of any object states that may have changed.
Looking back the last example in Initializing API Calls, we were able to fetch the data of our ListObject through the GetLayout method, but if we make a selection, we need to re-fetch the data by calling GetLayout again
listObjectLayout.call()

But there is an easier way. Qlik Hook Action methods (that is, methods that don't create object handles) have an input option that allows you to automatically re-call the api when an invalidation event occurs.
const listObjectLayout = useGetLayout(listObject, { params: [], invalidations: true })

Taking this and applying it to the last exmaple gives us a fully functioning ListObject that updates automatically on selection
import React, { useEffect, useState } from "react"
import { useConnectEngine } from "qlik-hooks"
import { useOpenDoc } from "qlik-hooks/dist/Global"
import { useCreateSessionObject } from "qlik-hooks/dist/Doc"
import { useSelectListObjectValues, useGetLayout } from "qlik-hooks/dist/GenericObject"

const Component = () => {
  const engine = useConnectEngine({
    host: "localhost",
    port: 4848,
  })

  const doc = useOpenDoc(engine, { params: ["Executive Dashboard.qvf"] })

  const listObject = useCreateSessionObject(doc, {
    params: [
      {
        qInfo: { qType: "listbox" },
        qListObjectDef: {
          qDef: { qFieldDefs: ["Region"] },
          qInitialDataFetch: [{ qWidth: 1, qHeight: 100 }],
        },
      },
    ],
  })

  const listObjectLayout = useGetLayout(listObject, { params: [], invalidations: true })

  const [list, setList] = useState([])
  useEffect(() => {
    if (listObjectLayout.qResponse !== null) {
      const qMatrix = listObjectLayout.qResponse.qListObject.qDataPages[0].qMatrix

      setList(
        qMatrix.map(row => ({
          label: row[0].qText,
          value: row[0].qElemNumber,
          state: row[0].qState,
        }))
      )
    }
  }, [listObjectLayout])

  const selectListObjectValues = useSelectListObjectValues(listObject)

  const handleListObjectSelection = value => {
    selectListObjectValues.call("/qListObjectDef", [value], true)
  }

  return (


        {list.map(listItem => (
           handleListObjectSelection(listItem.value)}
          >
            {listItem.label}

        ))}


  )
}

